import React from 'react';
import s from "./Users.module.css";
const Users = (props) => {
    return <div>
        {
        props.users.map(u => <div className={s.users} key={u.id}>
                <span>
                    <div><img src="/" alt=""/></div>
                    <div><button>Follow</button></div>
                </span>
                <span>
                    <div>{u.name}</div>
                    <div>{u.status}</div>
                </span>

            </div>
        )
    }
    </div>

}

export default Users;
